// src/components/MapView.js

import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup, Polyline } from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

// Set the default icon for the markers
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
    iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
    iconUrl: require('leaflet/dist/images/marker-icon.png'),
    shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

// Define bounding boxes for various states in India
const stateBoundaries = {
    "Andhra Pradesh": { latMin: 13.0, latMax: 19.0, lngMin: 80.0, lngMax: 84.0 },
    "Maharashtra": { latMin: 15.0, latMax: 24.0, lngMin: 72.0, lngMax: 80.0 },
    "Uttar Pradesh": { latMin: 26.0, latMax: 31.0, lngMin: 78.0, lngMax: 84.0 },
    "West Bengal": { latMin: 21.0, latMax: 27.0, lngMin: 85.0, lngMax: 89.0 },
    "Tamil Nadu": { latMin: 8.0, latMax: 14.0, lngMin: 77.0, lngMax: 81.0 },
    "Rajasthan": { latMin: 23.0, latMax: 30.0, lngMin: 69.0, lngMax: 78.0 },
    "Gujarat": { latMin: 20.0, latMax: 25.0, lngMin: 68.0, lngMax: 75.0 },
    "Karnataka": { latMin: 11.0, latMax: 18.0, lngMin: 74.0, lngMax: 78.0 },
    "Kerala": { latMin: 8.0, latMax: 12.0, lngMin: 76.0, lngMax: 78.0 },
    // Add more states as needed
};

// List of water bodies in India to avoid
const waterBodies = [
    { latMin: 8.0, latMax: 23.0, lngMin: 68.0, lngMax: 92.0 }, // Arabian Sea
    { latMin: 8.0, latMax: 11.0, lngMin: 76.0, lngMax: 79.0 }, // Bay of Bengal
    // Add more water body boundaries as needed
];

const isInWater = (latitude, longitude) => {
    return waterBodies.some(({ latMin, latMax, lngMin, lngMax }) => 
        latitude >= latMin && latitude <= latMax &&
        longitude >= lngMin && longitude <= lngMax
    );
};

const getRandomCoordinates = (state) => {
    const { latMin, latMax, lngMin, lngMax } = stateBoundaries[state];
    const maxAttempts = 10; // Limit number of attempts to find valid coordinates
    let attempts = 0;
    let coordinates;

    do {
        const latitude = Math.random() * (latMax - latMin) + latMin;
        const longitude = Math.random() * (lngMax - lngMin) + lngMin;
        coordinates = { latitude, longitude };
        attempts++;
    } while (isInWater(coordinates.latitude, coordinates.longitude) && attempts < maxAttempts);

    return coordinates; // Return coordinates even if it doesn't find valid ones after max attempts
};

const MapView = () => {
    const [markers, setMarkers] = useState([]);
    const [route, setRoute] = useState([]);
    const [randomPoints, setRandomPoints] = useState([]);

    const handleMapClick = (event) => {
        const { lat, lng } = event.latlng;
        if (markers.length < 2) {
            setMarkers((prev) => [...prev, { latitude: lat, longitude: lng }]);
        }
    };

    useEffect(() => {
        // Generate random points from different states
        const states = Object.keys(stateBoundaries);
        const points = Array.from({ length: 50 }, () => { // Reduced to 50 points
            const randomState = states[Math.floor(Math.random() * states.length)];
            return getRandomCoordinates(randomState);
        });
        setRandomPoints(points);
    }, []);

    useEffect(() => {
        if (markers.length === 2) {
            const routeCoordinates = [
                [markers[0].latitude, markers[0].longitude],
                [markers[1].latitude, markers[1].longitude]
            ];
            setRoute(routeCoordinates);
        }
    }, [markers]);

    return (
        <MapContainer
            center={[20.5937, 78.9629]} // Center of India
            zoom={5}
            style={{ height: "500px", width: "100%" }}
            onClick={handleMapClick}
        >
            <TileLayer
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                attribution='&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
            {randomPoints.map((point, index) => (
                <Marker key={index} position={[point.latitude, point.longitude]}>
                    <Popup>
                        Random Point {index + 1}: {point.latitude.toFixed(4)}, {point.longitude.toFixed(4)}
                    </Popup>
                </Marker>
            ))}
            {markers.map((marker, index) => (
                <Marker key={index} position={[marker.latitude, marker.longitude]}>
                    <Popup>
                        Marker {index + 1}: {marker.latitude.toFixed(4)}, {marker.longitude.toFixed(4)}
                    </Popup>
                </Marker>
            ))}
            {route.length === 2 && (
                <Polyline positions={route} color="blue" />
            )}
        </MapContainer>
    );
};

export default MapView;
